<!DOCTYPE html>
<html lang="en">

<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
  body {
    font-family: Arial, sans-serif;
    margin: 0;
    padding: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background-color: #f0f0f0;
  }
  #levelBox {
    background-color: #fff;
    padding: 40px;
    border-radius: 10px;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
    text-align: center;
    position: relative;
  }
  #levelNames, #levelId {
    font-size: 32px;
    margin-bottom: 20px;
  }
  #congratulations {
    font-size: 24px;
    margin-top: 20px;
    display: none;
  }
  #percentIndicator {
    position: absolute;
    top: 10px;
    right: 10px;
    font-size: 24px;
    font-weight: bold;
  }
  #copyButton, #nextButton, #skipButton {
    padding: 10px 20px;
    font-size: 20px;
    background-color: #007bff;
    color: #fff;
    border: none;
    border-radius: 10px;
    cursor: pointer;
    margin: 10px;
  }
</style>
</head>

  let shuffledLevels = [];
  let currentLevelIndex = 0;
  let percent = 1;
  let skipsRemaining = 3;

  const levelIdElement = document.getElementById('levelId');
  const levelNamesElement = document.getElementById('levelNames');
  const nextButton = document.getElementById('nextButton');
  const skipButton = document.getElementById('skipButton');
  const percentIndicator = document.getElementById('percentIndicator');
  const copyButton = document.getElementById('copyButton');
  const congratulationsElement = document.getElementById('congratulations');

  // Function to shuffle levels array
  function shuffleLevels() {
    let currentIndex = Object.keys(levelData).length;
    let temporaryValue, randomIndex;

    // While there remain elements to shuffle...
    while (currentIndex !== 0) {
      // Pick a remaining element...
      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex--;

      // And swap it with the current element.
      temporaryValue = shuffledLevels[currentIndex];
      shuffledLevels[currentIndex] = shuffledLevels[randomIndex];
      shuffledLevels[randomIndex] = temporaryValue;
    }
  }

  // Copy level IDs to shuffledLevels array
  shuffledLevels = Object.keys(levelData);

  shuffleLevels();

  nextButton.addEventListener('click', function() {
    if (percent < 100) {
      if (currentLevelIndex < shuffledLevels.length - 1) {
        currentLevelIndex++;
        percent++;
        displayLevel();
        updatePercent();
      } else {
        shuffleLevels();
        currentLevelIndex = 0;
        percent = 1;
        displayLevel();
        updatePercent();
      }
    } else {
      congratulationsElement.style.display = "block";
    }
  });

  skipButton.addEventListener('click', function() {
    if (skipsRemaining > 0 && currentLevelIndex < shuffledLevels.length - 1) {
      currentLevelIndex++;
      displayLevel();
      skipsRemaining--;
      skipButton.textContent = "Skip (" + skipsRemaining + ")";
    }
  });

  copyButton.addEventListener('click', function() {
    const levelId = shuffledLevels[currentLevelIndex];
    navigator.clipboard.writeText(levelId).then(function() {
      copyButton.textContent = 'Copied!';
      setTimeout(function() {
        copyButton.textContent = 'Copy ID';
      }, 1500);
    }, function(err) {
      console.error('Error copying ID to clipboard: ', err);
    });
  });

  function displayLevel() {
    const levelId = shuffledLevels[currentLevelIndex];
    levelIdElement.textContent = "ID: " + levelId;
    levelNamesElement.textContent = levelData[levelId];
  }

  function updatePercent() {
    percentIndicator.textContent = percent + "%";
  }

  displayLevel();
</script>
